import logo from './logo.svg';
import './App.css';


function App() {

  return (
    <div className="App">
  <form>
      <label for="name">Song Name:</label><br></br>
      <input type="text" id="name" />
      <label for="released">Year released:</label><br></br>
      <input type="date" id="released" />
      <label for="artist">Artists Name:</label><br></br>
      <input type="text" id="artist" />
      <input type="submit">Submit</input>
    </form>
    </div>
  );
}

export default App;
